class Solution {
    func makeTheIntegerZero(_ num1: Int, _ num2: Int) -> Int {
        if num2 == 0 { return -1 }
        var num1 = num1
        var operations = 0

        while num1 != 0 {
            if num1 % 2 == 0 && num2 % 2 == 0 {
                return -1
            }
            num1 -= num2
            operations += 1
            for i in 0...60 {
                if (1 << i) >= num1 {
                    num1 -= (1 << i)
                    operations += 1
                    break
                }
            }
        }
        return operations
    }
}
